                         // 0.910594820976,\012                                       // -0.562941968441,\012                                       // -0.200449213386,\012                                       // 0.820765554905\012    };//32\012    const type_t b1[NL1] = {0.842707276344,\012                            0.790710926056,\012                            0.649383246899,\012                            0.070417419076,\012                            0.408660680056,\012                            // 0.000172127271,\012                            // -0.381356090307,\012                            // 0.474602311850,\012                            // 0.004796015564,\012                            // 0.903386890888,\012                            // 0.413944244385,\012                            // 0.291701883078,\012                            // 0.186859875917,\012                            // 0.775032043457,\012                            // 0.980667233467,\012                            // -0.033508975059,\012                            // 0.136530324817,\012                            // -0.507931947708,\012                            // 0.280194580555,\012                            // -0.164520114660,//20\012                            // 0.115044556558,\012                            // 0.462207913399,\012                            // 0.053885340691,\012                            // -0.280169636011,\012                            // 0.863157331944,\012                            // -0.005371236242,\012                            // 0.433017969131,\012                            // 0.109317146242,\012                            // 0.449995666742,\012                            // 0.269712030888,\012                            // 0.507173120975,\012                            // -0.024444274604\012    }; //32\012    const type_t b2[NOUT] = {0.098531961441}; //1\012\012    inputdat layer_1;\012\012    #pragma unroll\012    for(int j=0;j<NL1;j++){\012        hls_register type_t acc = b1[j];\012        #pragma unroll\012        for(int i=0;i<NIN;i++){\012            type_t mult = input_1.data[i] * w1[i+NL1*j];\012            acc += mult;\012        }\012        layer_1.data[j]=acc;\012    }\012\012    outputdat o;\012\012    #pragma unroll\012    for(int j=0;j<NOUT;j++){\012        hls_register type_t acc = b2[j];\012        #pragma unroll\012        for(int i=0;i<NL1;i++){\012            type_t mult = layer_1.data[i] * w2[i+NOUT*j];\012            acc += mult;\012        }\012        o.data[j]=acc;\012    }\012\012    return o;\012}\012"}, {"path":"/home/therwig/data/TestQuartusHLS/firmware/myproject.h", "name":"myproject.h", "has_active_debug_locs":false, "absName":"/home/therwig/data/TestQuartusHLS/firmware/myproject.h", "content":"#ifndef MYPROJECT_H_\012#define MYPROJECT_H_\012\012#ifndef __INTELFPGA_COMPILER__\012#include \"ref/ac_int.h\"\012#include \"ref/ac_fixed.h\"\012#else\012#include \"HLS/ac_int.h\"\012#include \"HLS/ac_fixed.h\"\012#endif\012\012#include \"HLS/hls.h\"\012\012// use a single type for now\012typedef ac_fixed<26,6> type_t;\012\012#define NIN 10\012#define NL1 5\012#define NOUT 1\012\012struct inputdat {\012    type_t data[NIN];\012};\012\012struct outputdat {\012    type_t data[NOUT];\012};\012\012\012// Prototype of top level function for C-synthesis\012hls_component_ii(1)\012component outputdat myproject(\012    inputdat input_1\012);\012\012#endif\012"}, {"path":"/home/therwig/data/TestQuartusHLS/myproject_test.cpp", "name":"myproject_test.cpp", "has_active_debug_locs":false, "absName":"/home/therwig/data/TestQuartusHLS/myproject_test.cpp", "content":"//\012//    rfnoc-hls-neuralnet: Vivado HLS code for neural-net building blocks\012//\012//    Copyright (C) 2017 EJ Kreinar\012//\012//    This program is free software: you can redistribute it and/or modify\012//    it under the terms of the GNU General Public License as published by\012//    the Free Software Foundation, either version 3 of the License, or\012//    (at your option) any later version.\012//\012//    This program is distributed in the hope that it will be useful,\012//    but WITHOUT ANY WARRANTY; without even the implied warranty of\012//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\012//    GNU General Public License for more details.\012//\012//    You should have received a copy of the GNU General Public License\012//    along with this program.  If not, see <http://www.gnu.org/licenses/>.\012//\012#include <fstream>\012#include <iostream>\012#include <stdio.h>\012#include <stdlib.h>\012#include <math.h>\012\012#include \"firmware/myproject.h\"\012\012#define NTEST 10\012\012int main(int argc, char **argv)\012{\012  // insert test data\012  hls_register inputdat input_1[NTEST];\012  hls_register outputdat output_1[NTEST];\012\012  for (int i = 0; i < NTEST; ++i) {\012    for(int j = 0; j < NIN; ++j) {\012      // junk test data for now\012      input_1[i].data[j] = 0.3;\012    }\012    // run once for each test iteration\012    ihc_hls_enqueue(&output_1[i], myproject, input_1[i]);\012  }\012  ihc_hls_component_run_all(myproject);\012\012\012  // check output\012  for (int i = 0; i < NTEST; ++i) {\012    std::cout << \"Input: \";\012    for(int j = 0; j < NIN; j++) {\012      std::cout << input_1[i].data[j] << \" \";\012    }\012    std::cout << \";\";\012    std::cout << \"Output: \";\012    for(int j = 0; j < NOUT; j++) {\012      std::cout << output_1[i].data[j] << \" \";\012    }\012    std::cout << \";\";\012    std::cout << std::endl;\012  }\012\012  return 0;\012}\012"}, {"path":"/data/ntran/intelFPGA_pro/19.2/hls/include/HLS/task.h", "name":"task.h", "has_active_debug_locs":false, "absName":"/data/ntran/intelFPGA_pro/19.2/hls/include/HLS/task.h", "content":"#ifndef _INTEL_IHC_HLS_TASK\012#define _INTEL_IHC_HLS_TASK\012#include \"HLS/function_traits.h\"\012\012#include <type_traits>\012#include <utility>\012\012// Make sure the macros to take the user calls into implementations\012// is not in effect for the source code of the implementation\012#undef launch\012#undef collect\012\012// Bring in the platform specific '_task' for composition\012#if defined(__INTELFPGA_COMPILER__)  && !defined(HLS_X86)\012#include \"HLS/internal/_task_FPGA.h\"\012#else\012#include \"HLS/internal/_task_X64.h\"\012#endif\012\012namespace ihc {\012  namespace internal {\012    // The task is a singleton that is shared between\012    // a calculation and its result:\012    // * Launch the calculations\012    //   task<function>::launch(args...);\012    // * Get the results\012    //   [ret = ]task<function>::collect();\012    //      > blocking until launch is finished\012    //      > returns result for non-void function\012    //\012    // When the main program exits, any pending\012    // launches will still be processed in their\012    // respective thread\012    //\012    // The task is implemented as an\012    // Adaptor Design Pattern\012    // The X64 or FPGA implementation is adapted to the desired API\012    // This adaptor is straight forward:\012    // Both architecture specific implementations are supposed to\012    // be interface compatible with this adaptor\012    template<typename X, X& f>\012    class task {\012    public:\012      // using F: typename X is different between compilers!\012      using F = decltype(f);\012      using T = typename ihc::function_traits<F>::return_type;\012\012      // Launch the callable\012      template<typename ... Args>\012      static void launch(Args&& ... args) {\012        return _t.launch(std::forward<Args>(args)...);\012      }\012\012      // Get the result\012      static T collect() {\012        // Restore void if needed\012        return static_cast<T>(_t.collect());\012      }\012\012    private:\012      // Constructor\012      task() {};\012      // Destructor\012      // Can't be explicit for FPGA target in Intel(R) HLS Compiler\012      //~_task() {}\012\012      // Composition (_task is architecture specific)\012      // Singleton\012      // Anywhere in the function hierarchy where \"f\" gets called,\012      // this specific task (with the corresponding thread and queue)\012      // needs to be used\012      static internal::_task<X, f> _t;\012    }; // class task\012\012    template <typename X, X& f>\012    internal::_task<X, f> task<X, f>::_t;\012\012    // Launch (through singleton)\012    template< class X, X&  f, typename... Args>\012    void launch(Args&&... args) {\012      task<X, f>::launch(std::forward<Args>(args)...);\012    }\012\012    // Collect (through singleton)\012    template< typename X, X& f>\012    typename ihc::function_traits<decltype(f)>::return_type collect() {\012      // using F: typename X is different between compilers!\012      using F = decltype(f);\012      using T = typename ihc::function_traits<F>::return_type;\012      // Restore void if needed\012      return static_cast<T>(task<X, f>::collect());\012    }\012  } // namespace internal\012\012  // Fake functions to help with Content Assist (IntelliSense)\012\012  // /!\\ Please remember to put parentheses around a launch of\012  //     a templated function:\012  //     ihc::launch(\012  //       ( foo<Types...> ),\012  //       args... );\012  template<typename F, typename... Args>\012  void launch(F&& f, Args&&...args);\012  template<typename F>\012  typename ihc::function_traits<F>::return_type collect(F&& f);\012\012} // namespace ihc\012\012// Work around for C++14 (no support for <auto& f>\012#define launch(x, ...)  internal::launch<decltype(x),x>(__VA_ARGS__)\012#define collect(x)      internal::collect<decltype(x),x>()\012\012#endif // _INTEL_IHC_HLS_TASK\012"}];